import React from 'react';

export const Create = ({ navigation }) => {
	return (
		<div>
			<form id="Create">
				<h4>Create Account</h4>
				<input type="text" name="Email" placeholder="Email"/>
				<input type="text" placeholder="Password" maxlength="12" minlength="6"/>
				<div className="progress-bar" style={{ width:'70%', background:'red'}}></div>
				<input type="text" placeholder="Confirm Password"/>

				<div className="btn_box">
					<button type="button" id="Next_Info" onClick={() => navigation.next()}>
						Next
					</button>
				</div>
			</form>
		</div>
	);
};
